import Button from "./Button";

const Keyboard = () => {
    function click(e){
        console.log(e.id);
    }
    return (
        <>
            <Button name = "a" class_Name = "keyboard" onClick = {click} id='key_a' />
            <Button name = "b" class_Name = "keyboard" onClick = {click} id='key_b' />
            <Button name = "c" class_Name = "keyboard" onClick = {click} id='key_c' />
            <Button name = "d" class_Name = "keyboard" onClick = {click} id='key_d' />
            <Button name = "e" class_Name = "keyboard" onClick = {click} id='key_e' />  
        </>
    )
}

export default Keyboard
